import React, { useEffect, useState } from 'react';
import { Input, InputGroup, InputRightElement,Tabs, TabList, TabPanels, Tab, TabPanel , Button, Divider, Center, Stack } from '@chakra-ui/react';
import Navbar from "../pages/navbar";
import Footer from "../pages/footer";

import styles from "../pages/addproperty.module.css";

function AddProperty()
{
    const [propertyImage,setpropertyImage]=useState=("");
    const [propertyName,setpropertyName]=useState=("");
    const [Beds,setBeds]=useState=(0);
    const [Bathroom,setBathroom]=useState=(0);
    const [propertyaddress,setpropertyaddress]=useState=("");
    const [propertyPrice,setpropertyPrice]=useState=(0);
return (
    <div>
      <Navbar />
      <Center height='100px'>
        <Divider />
      </Center>
      <div className={styles.container}>
        <Tabs variant='soft-rounded' colorScheme='green'>
          <TabList>
            <Tab>Add Property Details</Tab>
          </TabList>
            <TabPanel>
              <form>
                <Stack spacing={4}>
                  <Input placeholder='Enter Property image url' size='lg' value={propertyImage} onChange={(e) => setpropertyImage(e.target.value)} />
                  <Input placeholder='Enter Property Name' size='lg' value={propertyName} onChange={(e) => setpropertyName(e.target.value)} />
                  <Input placeholder='Enter Number Of Beds' size='lg' value={Beds} onChange={(e) => setBeds(e.target.value)} type='number'/>
                  <Input placeholder='Enter Number of Bathrooms' size='lg' value={Bathroom} onChange={(e) => setBathroom(e.target.value)} type='number' />
                  <Input placeholder='Enter Property Address' size='lg' value={propertyaddress} onChange={(e) => setpropertyaddress(e.target.value)} />
                  <Input placeholder='Enter Property Price' size='lg' value={propertyPrice} onChange={(e) => setpropertyPrice(e.target.value)} />
                  <Button colorScheme='green' size='lg' >Login</Button>
                </Stack>
              </form>
            </TabPanel>

        </Tabs>
      </div>
      <Center height='100px'>
        <Divider />
      </Center>
      <Footer />
    </div>
);
}

export default AddProperty;
